// src/components/Control.js

import React from 'react';
import { Paper, Typography } from '@mui/material';

const Control = () => {
  function Item(props) {
    const { sx, ...other } = props;
    return (
      <Box
        sx={[
          (theme) => ({
            p: 1,
            m: 1,
            bgcolor: 'grey.100',
            color: 'grey.800',
            border: '1px solid',
            borderColor: 'grey.300',
            borderRadius: 2,
            fontSize: '0.875rem',
            fontWeight: '700',
            ...theme.applyStyles('dark', {
              bgcolor: '#101010',
              color: 'grey.300',
              borderColor: 'grey.800',
            }),
          }),
          ...(Array.isArray(sx) ? sx : [sx]),
        ]}
        {...other}
      />
    );
  }

  Item.propTypes = {
    /**
     * The system prop that allows defining system overrides as well as additional CSS styles.
     */
    sx: PropTypes.oneOfType([
      PropTypes.arrayOf(
        PropTypes.oneOfType([PropTypes.func, PropTypes.object, PropTypes.bool]),
      ),
      PropTypes.func,
      PropTypes.object,
    ]),
  };
  return (
    <Paper style={{ padding: '20px', margin: '10px', backgroundColor: '#ffffff' }}>
      <Typography variant="h4" gutterBottom>Control Panel</Typography>
      <Typography variant="body1">Manage your settings and controls here.</Typography>
    </Paper>
  );
};


export default Control;
